import React from 'react'
import { Segment,Grid, Header } from 'semantic-ui-react'

class Messages extends React.Component{



    render(){
        const style ={
            width:'300px',
            height: '350px',
            position: 'fixed',
            top: '60%',
            left: '80%'
        }
        return(
            <Segment stacked style={style} >
                <Header color='blue'  as='h4'>Messages</Header>
            </Segment>
        )

    }

}

export default Messages
